    /**
     * Returns the first token in the linked list of tokens generated from <code>text</code>. This method must be
     * implemented by subclasses so they can correctly implement syntax highlighting.
     * 
     * @param text
     *            The text from which to get tokens.
     * @param initialTokenType
     *            The token type we should start with.
     * @param startOffset
     *            The offset into the document at which <code>text</code> starts.
     * @return The first <code>Token</code> in a linked list representing the syntax highlighted text.
     */
    public Token getTokenList(Segment text, int initialTokenType, int startOffset) {

        resetTokenList();
        this.offsetShift = -text.offset + startOffset;

        // Start off in the proper state.
        int state = Token.NULL;
        switch (initialTokenType) {
        case Token.COMMENT_MULTILINE:
            state = COMMENT;
            start = text.offset;
            break;
        case Token.FUNCTION:
            state = DTD;
            start = text.offset;
            break;
        case Token.LITERAL_STRING_DOUBLE_QUOTE:
            state = INATTR_DOUBLE;
            start = text.offset;
            break;
        case Token.LITERAL_CHAR:
            state = INATTR_SINGLE;
            start = text.offset;
            break;
        case Token.PREPROCESSOR:
            state = PI;
            start = text.offset;
            break;
        case INTERNAL_INTAG:
            state = INTAG;
            start = text.offset;
            break;
        case INTERNAL_INTAG_SCRIPT:
            state = INTAG_SCRIPT;
            start = text.offset;
            break;
        case INTERNAL_ATTR_DOUBLE_QUOTE_SCRIPT:
            state = INATTR_DOUBLE_SCRIPT;
            start = text.offset;
            break;
        case INTERNAL_ATTR_SINGLE_QUOTE_SCRIPT:
            state = INATTR_SINGLE_SCRIPT;
            start = text.offset;
            break;
        case INTERNAL_IN_AS:
            state = AS;
            start = text.offset;
            break;
        case INTERNAL_IN_AS_MLC:
            state = AS_MLC;
            start = text.offset;
            break;
        case Token.VARIABLE:
            state = CDATA;
            start = text.offset;
            break;
        default:
            state = Token.NULL;
        }

        s = text;
        try {
            yyreset(zzReader);
            yybegin(state);
            return yylex();
        } catch (IOException ioe) {
            ioe.printStackTrace();
            return new DefaultToken();
        }

    }

